// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Dashboard from './componentes/Dashboard';  // Ensure this path matches the location of Dashboard.js
import Home_Page from './componentes/Home_Page';
const App = () => {
  return (
    <Router>
      <Routes>
        {/* Main Dashboard Route */}
        <Route path="/" element={<Dashboard />} />

        {/* Additional routes */}
        {/* <Route path="/manage-admin" element={<ManageAdmin />} /> */}
        <Route path="/Home_Page" element={<Manage_Home_Page/>} />
      </Routes>
    </Router>
  );
};

export default App;
